  .header {
    position: relative;
  }

  .head {
    font-size: 16pt;
  }

  .h2 {
    font-size: 18pt;
  }

  html,
  body {
    margin: 0;
    padding: 10;
    font-size: 14pt;
    font-family: 'THSarabunNew';
    background-color: white;
    line-height: 1.1;
  }

  .table {
    border-spacing: 0;
    border-collapse: collapse;
    width: 100%;
  }

  .table2 {
    border-spacing: 0;
    border-collapse: collapse;
    width: 100%;
    font-size: 14pt;
    table-layout: fixed;
    word-wrap: break-word;
    overflow-wrap: break-word;
  }

  .table-border {
    border-collapse: collapse;
    width: 100%;
    font-size: 14pt;
    border: 1px solid black;
  }

  .border {
    border: 1px solid black;
  }

  table tr,
  td {
    border: 0px solid black;
    padding-left: 5px;
    padding-right: 5px;
  }

  table th {
    border-top: 1px dashed black;
    border-bottom: 1px dashed black;
    padding-left: 5px;
    padding-right: 5px;
  }

  .left {
    text-align: left;
  }

  .right {
    text-align: right;
  }

  .center {
    text-align: center;
  }

  .bold {
    font-weight: bold;
  }

  .noneBold {
    font-weight: none;
  }

  .top {
    vertical-align: top;
  }

  .mid {
    vertical-align: middle;
  }

  .btn {
    display: inline-block;
    padding: 6px 12px;
    margin-bottom: 0;
    font-size: 14px;
    font-weight: normal;
    line-height: 1.42857143;
    text-align: center;
    white-space: nowrap;
    vertical-align: middle;
    -ms-touch-action: manipulation;
    touch-action: manipulation;
    cursor: pointer;
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
    background-image: none;
    border: 1px solid transparent;
    border-radius: 4px;
  }

  .btn-sm {
    margin-top: 10px;
